import React, { Component } from "react";
import Box from "./box";

class Game extends Component {
  state = {
    boxes: [
      { id: 1, value: "O" },
      { id: 2, value: "X" },
      { id: 3, value: "X" },
      { id: 4, value: "X" },
      { id: 5, value: "X" },
      { id: 6, value: "X" },
      { id: 7, value: "X" },
      { id: 8, value: "X" },
      { id: 9, value: "X" }
    ]
  };
  render() {
    return (
      <div className="game">
        {this.state.boxes.map(box => (
          <Box key={box.id}>{box.value}</Box>
        ))}
      </div>
    );
  }
}

export default Game;
